  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then                                 U.S. Census Bureau's Master Address File
  / Topologically Integrated Geographic Encoding and Referencing (MAF/TIGER) Database
  (MTDB).n                                 The MTDB represents a seamless national
  file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
  is designed ton                                 stand alone as an independent data
  set, or they can be combined to cover the entire nation.nn                                 The
  Census Bureau includes landmarks such as military installations in the MTDB for
  locating special features and to help enumeratorsn                                 during
  field operations.  In 2012, the Census Bureau obtained the inventory and boundaries
  of most military installations from the U.S.n                                 Department
  of Defense (DOD) for Air Force, Army, Marine, and Navy installations and from the
  U.S. Department of Homeland Security (DHS)n                                 for
  Coast Guard installations. nn                                 The military installation
  boundaries in this release represent the updates the Census Bureau made in 2012
  in collaboration with DoD.n            \",\n\t\"license_title\": null,\n\t\"extras\":
